class Solution {
    fun makeTheIntegerZero(num1: Int, num2: Int): Int {
        var count = 0
        var n1 = num1
        if (num2 == 0) return -1
        while (n1 > 0) {
            var found = false
            for (i in 60 downTo 0) {
                val operation = (1 shl i) + num2
                if (n1 - operation >= 0) {
                    n1 -= operation
                    count++
                    found = true
                    break
                }
            }
            if (!found) return -1
        }
        return if (n1 == 0) count else -1
    }
}
